import React, { Component } from 'react'
import './App.css'

function greeting () {
  console.log('hello')
}

export default class App extends Component {
  render() {
    return (
      <div>
        <button onClick={greeting}>Mybutton</button>
        <button>Mybutton</button>
        <button>Mybutton</button>
      </div>
    )
  }
}
